import React from 'react';
import { useLocation } from 'react-router-dom';

const  About = (props) => {
    const  location = useLocation();
    return(
        <>
            <h1>My Name Is {props.name}</h1>
            <br/>
            <p1>My current location is {location.pathname }</p1>
        </>
    );
}

export default About;
